INSERT INTO `amx_metric_catalogue` VALUES ('Cb1',36,'Cb','Collected cycle deviation ','Determine the ratio of payments for the bill-cycle that are collected before the bill-cycle cut-off date (Alternative: payment due date)','abs(1-(#716)/(#640))',0.13000,0.07000,'640, 716','M','Y','2015-08-31 22:00:00',NULL,'N','Task 2016/01 -> closed\nTask 2016/150 -> Dato 716 adjusted, so check recalculation i.e. tune Dato 640? -> closed','Y','Y','2015-01-01 00:00:00','2015-12-27 21:50:23',134,'{\"RevenueAndCostAssurance\":\"Y\"}'),('Cb2',36,'Cb','Collection vs. Entries accounts Reconciliation ','Determine the ratio of unallocated payments of a month','abs(1-(#717)/(#716))',0.01000,0.00600,'716, 717','M','Y','2015-08-31 22:00:00',NULL,'N','','N / A','Y','2015-01-01 00:00:00','2015-10-28 07:04:16',141,'{\"RevenueAndCostAssurance\":\"Y\"}'),('Cb3',36,'Cb','Collection by billing cycle Variation index','Determine the variation of the collections amount from the previous bill-cycle','abs((#716)/(#716m2)-1)',0.15000,0.02000,'716','M','Y','2016-06-24 14:25:26',NULL,'Y','Use following statement (coordinated with and approved by G. Scholz 17th June 21) when closing standard Cb3-alarms:\nThe implementation of bi-monthly BCs billing 2 periods in advance in ADX billing in September 2020 for specific customers (those without electronic invoice – the main goal was to reduce costs for invoice production and postage), \nin combination with indexing effects and tariff-price developments, are recurring effecting bi-monthly deviations in cash-collection figures (number and amount of collected payments) in A1 AUT. Those plausible deviations are constantly monitored and verified within A1 Finance and are corresponding to the expected development of the cash-collection figures.','N','Y','2015-01-01 00:00:00','2015-10-08 21:48:00',148,'{\"RevenueAndCostAssurance\":\"Y\"}'),('Cb4',36,'Cb','Applied Payments Quality Index','Determine not allocated payments balance correctness of the last month','abs(1-(#719)/((#718)+(#716)-(#717)))',0.00000,0.00200,'716, 717, 718, 719','M','Y','2015-09-01 00:00:00',NULL,'N','Task 2016/2 => Datos 716, 717, 718 & 719 adapted','Y','Y','2015-01-01 00:00:00','2015-11-02 20:01:06',155,'{\"RevenueAndCostAssurance\":\"Y\"}'),('Cb5',36,'Cb','Not applied Payments Variation Index','Identify anomalous changes in the behavior of unallocated payments','(#719m1)/(#719m3)-1\n',0.00000,0.00200,'719','M','N','2015-08-31 22:00:00',NULL,'Y','Task 2016/4\n\nWe agreed with AMX on the 16th of March 2016 that Cb5 will only be applicable at subsidiaries having cash payments higher than 30% in relation to the overall payment amount. Referring to the presentation \nwe attached for A1, the cash payments only make up less than 0,5% of the overall collected amount per month, therefore it is not applicable for the Austrian market as the internal fraud risk. which is the risk to be mitigated by this metric, can be categorized as fairly minor…\n \nSee Documentation\n\\\\jtsfwnas2\\jt_a_oneaccounting$\\07FP&ICS\\06_OE_Revenue_Assurance\\30 TAG RACO\\A1\\AW AMX TAG JFX 20160316.msg','Y','N','2015-01-01 00:00:00','2015-10-08 21:48:00',162,'{\"RevenueAndCostAssurance\":\"Y\"}'),('Co1',36,'Co','Incoming vs. Billing reconciliation index','Identify the differences between the booked revenues in accounting  and the invoiced revenue','abs(1-(#115)/((#040)+(#043)))',0.01000,0.04000,'040, 043, 115','M','Y','2016-11-30 11:06:14',NULL,'N',NULL,'N','Y','2015-01-01 00:00:00','2017-06-01 14:27:27',169,'{\"RevenueAndCostAssurance\":\"Y\"}'),('Co2',36,'Co','Revenue Provision deviation index','Identify the deviation between  revenue accruals unbilled revenues and billed revenues corresponding to previous revenue accruals','abs((#117)/(#118)-1)',0.02000,0.02000,'117, 118','M','Y','2017-01-12 13:17:19',NULL,'N',NULL,'N','Y','2015-01-01 00:00:00','2015-10-08 21:48:00',176,'{\"RevenueAndCostAssurance\":\"Y\"}'),('Co3',36,'Co','Revenue´s Provision Cancellation Index','Confirmation that the revenue accruals are reversed in the following month','abs(1-(#119)/(#117))',0.00000,0.00000,'117, 119','M','Y','2016-11-30 15:22:58',NULL,'N',NULL,'N','Y','2015-01-01 00:00:00','2015-10-08 21:48:00',183,'{\"RevenueAndCostAssurance\":\"Y\"}'),('Co4',36,'Co','Air Time Cancellation Deviation Index','Identify if debt by air time (deferred revenues) has been cancelled according to the prepaid´s air time consumption','abs(1-((#120)+(#282))/(((#149)-(#283))*(1-(#266))))',0.01000,0.04000,'120, 149, 266, 282, 283','M','Y','2017-02-16 13:51:23',NULL,'N','','N','Y','2015-01-01 00:00:00','2015-10-08 21:48:01',190,'{\"RevenueAndCostAssurance\":\"Y\"}'),('Co5',36,'Co','Revenue Variation Index','Identify anomalous variations of the billed revenues','abs((#115m1)/(#115m3)-1)',0.10000,0.10000,'115','M','Y','2017-01-12 13:30:55',NULL,'Y',NULL,'N','Y','2015-01-01 00:00:00','2016-03-14 17:46:41',197,'{\"RevenueAndCostAssurance\":\"Y\"}'),('Co6',36,'Co','Estimated Revenue Deviation Index','Identify anomalous variations of the revenue accruals','abs((#117)/(#117m2)-1)',0.10000,0.10000,'117','M','Y','2016-03-01 00:00:00',NULL,'Y',NULL,'N','Y','2015-01-01 00:00:00','2015-10-08 21:48:01',204,'{\"RevenueAndCostAssurance\":\"Y\"}'),('D1',36,'D','Suppliers Payment Deviation Index','Identify that all the payments to content suppliers have been invoiced to our clients','1-(#176)/(#177)',0.00000,0.00200,'176, 177','M','Y','2016-10-03 13:56:05',NULL,'N','Task 2016/17 -> Task closed on 25.02.2016','N','N','2015-01-01 00:00:00','2016-07-26 14:51:30',211,'{\"DigitalEcosystemAssurance\":\"Y\"}'),('D2',36,'D','VAS Process Quality Index','Ratio of VAS mediation events that have not been invoiced to clients','abs(1-(#178)/(#179))',0.02500,0.00200,'178, 179','D','Y','2016-10-24 15:30:31',NULL,'N','Task 2016/19\nready for fine-tuning\nBasically we do not get a couple of switches from Mediation (e.g. VOLTE) so I also had to exclude those records from Billing counts.','N / A','Y','2015-01-01 00:00:00','2019-03-11 16:45:14',218,'{\"RevenueAndCostAssurance\":\"Y\"}'),('D3',36,'D','Customer Roaming Rating Quality Index','Determine the ratio of customer roaming events which have not been rated','1-(#180)/(#181)',0.01000,0.04000,'180, 181','D','Y','2016-10-24 15:32:31',NULL,'N','Task 2016/213 - \nwe have known discrepancies in the operational system between TAPIN and ADATA. So the deviations are due to this. We are working with operations to improve quality','N / A','Y','2015-01-01 00:00:00','2018-10-11 16:17:24',225,'{\"MarginAssurance\":\"Y\"}'),('F10',36,'F','Electronic Invoices Index','Ratio of electronic invoices to the total invoices issued','-1* abs((#199)/((#034)-(#276)))',-0.40000,0.00000,'034, 199, 276','M','Y','2017-01-01 00:00:00',NULL,'N','Original: Cuantificar las facturas no impresas del proceso de facturación.\nTranslation: Quantify unprinted invoices from the billing process.','N','Y','2015-01-01 00:00:00','2017-06-13 13:53:26',232,'{\"RevenueAndCostAssurance\":\"Y\"}'),('F11',36,'F','Credit notes on billing cycle ','Ratio of adjustments to total invoiced amount','abs((#043)/(#040))',0.01500,0.01500,'040, 043','M','Y','2016-11-30 13:51:17',NULL,'N','','N','Y','2015-01-01 00:00:00','2015-10-08 21:48:01',239,'{\"RevenueAndCostAssurance\":\"Y\"}'),('F2',36,'F','Rating vs Billing process flow deviation Index','Determine the deviation between the EDRs data output of the rating process vs the EDRs data entry to the billing process','abs(1-(#206)/(#030))',0.00000,0.00200,'030, 206','D','N','2015-09-01 00:00:00',NULL,'N',NULL,'N','N','2015-01-01 00:00:00','2015-10-08 21:48:01',246,'{\"RevenueAndCostAssurance\":\"Y\"}'),('F3',36,'F','Billing Quality Index (Events)','Verify that all Rated Events are Billed','abs(1-((#031)+(#032))/(#033))',0.03000,0.03000,'031, 032, 033','M','Y','2017-02-16 13:51:15',NULL,'N',NULL,'N','Y','2015-01-01 00:00:00','2015-10-08 21:48:01',253,'{\"RevenueAndCostAssurance\":\"Y\"}'),('F5',36,'F','Billing Quality Index ( Printed invoices)','Determine the deviation between the Printed Invoices and the Billed Invoices which should have been printed','1-(#036)/((#034)-(#037)-(#199))',0.00200,0.00200,'034, 036, 037, 199','M','Y','2017-05-01 00:00:00',NULL,'N','There are issues with the format of ADX invoice media report. See remarks: http://vlreaap001.at.inside:9000/datasource-info?datasourceId=842','N','Y','2015-01-01 00:00:00','2019-04-04 09:36:36',260,'{\"RevenueAndCostAssurance\":\"Y\"}'),('F6',36,'F','Rejected Invoices Index','Determine the proportion of the Rejected Invoices over the Issued Invoices on a bill-cycle','(#038)/(#039)',0.01000,0.04000,'038, 039','M','Y','2016-09-01 00:00:00',NULL,'N',NULL,'N','Y','2015-01-01 00:00:00','2019-04-04 09:34:36',267,'{\"RevenueAndCostAssurance\":\"Y\"}'),('F7',36,'F','Billing average by client variation index','Revenue per client (subscribers, lines) including tax','-1 * ((#040)+(#043))/(#041)',-27.00000,1.00000,'040, 041, 043','M','Y','2016-09-01 00:00:00',NULL,'N','arpu differs very much between bill cycles. solution => big threshold? 5-40?\nThis must be a monthly Metric to make any sense. Ask','N','Y','2015-01-01 00:00:00','2017-06-01 14:10:28',274,'{\"RevenueAndCostAssurance\":\"Y\"}'),('F8',36,'F','Billing variation Index','Compare the total invoiced amount per bill-cycle of current period to previous period','abs((#040)/(#040m2)-1)',0.03500,0.01500,'040','M','Y','2016-11-30 13:36:18',NULL,'Y','investigate on alarms, increase threshold probably next months, when we have the knowledge about root causes','N','Y','2015-01-01 00:00:00','2017-03-01 17:19:48',281,'{\"RevenueAndCostAssurance\":\"Y\"}'),('F9',36,'F','Rejected invoices variation index ','Compare the ratio of the Rejected Invoices over the Issued Invoices of the current period to the previous period','((#038)/(#039))/((#038c1)/(#039c1))-1',0.02000,0.00500,'038, 039','M','N','2015-09-01 00:00:00',NULL,'N','Actually n/a according to AMX\n\\\\jtsfwnas2\\jt_a_oneaccounting$\\07FP&ICS\\06_OE_Revenue_Ass