cted records.','abs(1-((#062)+(#063)+(#064))/((#058)+(#065)))',0.02000,0.00500,'058, 062, 063, 064, 065','D','Y','2018-11-12 14:13:52',NULL,'N','Since it\'s not possible to use audit tables (different basis for timestamps than CDRs themselves) - filtering rules have to be already taken in consideration into dato #058 thus rendering dato #063 unused. Also re-injection of records is not in the process therefore dato #065 is empty','N','Y','2015-01-01 00:00:00','2015-10-08 19:48:03',330,'{\"RevenueAndCostAssurance\":\"Y\"}'),('I4',36,'I','Interconnection Process Quality Index','Determine an Index of Quality in the Interconnection Process (total duration of EDRS). The Input plus the Re-injections must be equal to the output records plus the filtered and rejected records.','abs(1-((#066)+(#067)+(#068))/((#060)+(#069)))',0.02000,0.00500,'060, 066, 067, 068, 069','D','Y','2015-09-01 00:00:00',NULL,'N',NULL,'N','N','2015-01-01 00:00:00','2015-10-08 19:48:03',337,'{\"RevenueAndCostAssurance\":\"Y\"}'),('I5',36,'I','Rejected Records in Interconnection Index','Determine an Index of Rejected EDRs during the Interconnection process','(#064)/(#058)',0.02000,0.00500,'058, 064','D','Y','2017-02-16 14:21:27',NULL,'N',NULL,'N','Y','2015-01-01 00:00:00','2015-10-08 19:48:03',344,'{\"RevenueAndCostAssurance\":\"Y\"}'),('I7',36,'I','Index of the EDRs variation in Interconnection','Determine the percentage of EDRs variation in the Interconnection Process','abs(((#058d2)/7)/((#058d3)/7)-1)',0.05000,0.05000,'058','D','Y','2022-01-01 15:26:08',NULL,'Y',NULL,'N','Y','2015-01-01 00:00:00','2018-10-03 14:01:42',351,'{\"RevenueAndCostAssurance\":\"Y\"}'),('I9',36,'I','Index of an anomalous variation of the rejected EDRs in Interconnection','Determine an anomalous variation of the Rejected EDRs during the Interconnection process','((#064)/(#058))/((#064d1)/(#058d1))-1',0.02000,0.00500,'058, 064','D','N','2015-09-01 00:00:00',NULL,'N','Actually n/a according to AMX\n\\\\jtsfwnas2\\jt_a_oneaccount