INSERT INTO `amx_procedure_catalogue` VALUES (1,'AI1','Provisioning of Services','Provisioning','Reconciliation of Subscribers in the different platforms (Activated, Reactivated, Suspensions, block)','Are there revenue losses due to a lack of the correct activation, deactivation, modifications to lines and services in the different platforms that provide the services?','Lines and Broad Band: Status, plan, services, functionalities and bundles in the Platforms','completeness and correctness: All subscribers are configured in the administrative systems (BSS) as well as service platforms and the configurations are correct if compared with the administrative systems '),(2,'AI2','Plans and Promotions','Mediation, Rating & Billing','Monitoring Plans and Promotions','Are there revenue losses due to the incorrect configuration in the transactional Systems involved with the Promotions and authorized Plans?','All Plans and Promotions defined in the different Business Lines (Prepaid, Postpaid, Wireline, Broad Band, TV, Interconnections, etc): \n- Services, fees, effective dates, segments, sales channels, prices, redemptions, national and international destinies','completeness: All tariff plans and promotions are configured in the systems \ncorrectness: The configurations are correct if compared with product definition document authorized by commercial responsible'),(3,'AI3','Provisioning Execution Time','Provisioning','Monitoring the execution of Provisioning','Are there revenue losses because of ovedue provisioning of the service?','All Provisioning transactions:\nRequest Date, Provisioning Date, Service agreement according to the product or service ','Provisioning date is compliant to agreed service level\ncompleteness: All orders are provisioned\ncorrectness: The correct service was provisioned'),(4,'AI4','Mediation Rules','Mediation','Verification of the Mediation Rules','Are there revenue losses due to errors in the application of the mediation rules?','Classified records by the Mediation Platform','Completeness: All records are classified by mediation device with at business rule.\nCorrectness: The records are classified correctly by the mediation device.\nExistence: The mediation device has valid rules according to business operation'),(5,'AI5','Traffic on Blocked Lines','Provisioning','Verify that no traffic exist on blocked lines','Are there revenue losses because of Blocked lines that are still generating traffic?','All Blocked Lines: Status of the Lines, Voice and Events Traffic','completeness and correctness: No  traffic is generated by blocked subscribers.'),(6,'AI6','Rating Errors','Rating','Analyze errors on the rating process (including roaming & Interconnection)','Are there revenue losses because of EDRs records rated wrong?','EDRs rated. Day and night rates are considered','Completeness and correctness: All EDRs are rated correctly based on tariff plans and approved business rules.'),(7,'AI7','Invoice Charges','Billing','Verification of Billing charges','Are there revenue losses due to errors in generating the charges of invoices?','For all the valid plans:\nAmount of usage, recurrent charges, recurrent charges, services charges and events charges','Completeness and correctness: All concepts, total sums and dates of services used are applied correctly'),(8,'AI8','Adjustments applied to Invoices','Billing','Verification of Billing Adjustments','Are there revenue losses because of not authorized or unfair Adjustments?','All the users that have access to the CRM: \nProfile defined in the System and the allowed amount','Completeness and Authorization: All applied adjustments were authorized\nExistence: The adjustments have an existing origin\nCorrectness: The adjustments are booked by a user with the correct (authorized) profile for the amount.'),(9,'AI9','Interconnection traffic, access charges and Roaming','Rating','Monitoring the rates in Interconnection-Billing and Roaming','Are there revenue losses due to errors in the application of Interconnection (National and International) Fees, access charges and Roaming?','Roaming and Interconnection rates and Access Charges','Completeness and correctness: All tariff plans for interconnection services, local and internation as well as roaming are the one agreed and are applied correctly'),(10,'AI10','Prepaid Cards Stolen or Lost','Activation of PIN','Monitoring the Prepaid Cards','Have the Stolen of Lost Prepaid cards been deactivated on time?','All Lost or stolen cards:\nStatus, Amount, denominations, Deactivated Date','Completeness: All stolen or lost sim-cards are disabled beginning with the date the loss was reported\n'),(11,'AI11','Hybrid Plan Numbers','Provisioning and Billing','Verify that Hybrid plans numbers are activated in the Prepaid and Postpaid Platform','Have all the hybrid plans been activated in the prepaid and postpaid platform?','All Hybrid Lines:\nStatus and Plans','Completeness: All subscribers of mixed plans are registered in prepaid, postpaid and network platforms\nCorrectness: Correct configuration of subscribers in platforms'),(12,'AI12','Massive automatic top-ups for Hybrid Plan Numbers','Balance Management','Verify the massive automatic top-up of balances in Hybrid plans at the beginning of the bill-cycle.','Have the hybrid plans been charged correctly and on time?','All Hybrid Lines:\nTop-up and its amount','Completeness: All mixed subscribers have an automatically topped up balance\nExistence: All automatically top up balances have a correct and real source\nCorrectness: The charge is according to the plan and the cut off date'),(13,'AI13','PINs Activations in Prepaid','Prepaid','Verify that all the SIIM cards are activated in the prepaid platform','Are revenue losses due to errors of the loaded PINs in the prepaid platform?','All activate PINs:\nAmount, denominations, billing date and amount of the distribution channel','Completeness: All generated PINs are available for sales in the prepaid platform\nCorrectness: The PINs are activated according to the correct distribution channel.\n'),(14,'AI14','Adjustments in Revenue Accounts','Accounting','Verify the Adjustments in the Revenue Accounts','Are all the revenue accounting adjustments fair and authorized?','Adjustments to Revenue accounts originated by the Billing process and the prepaid consumption','Completeness and Authorization: All applied adjustments were authorized\nExistence: The adjustments have an existing origin\nCorrectness: The adjustments are booked by a user with the correct (authorized) profile for the amount.'),(15,'AI15','Revenue accounting entry','Accounting','Validate the correct generation of book entries','Are all the accounting entries accurate?','Revenue account entries of the products and services supplied, e.g. recurrent charges, romaing, interconnection, access charges and prepaid','Completeness: All revenues are registered in the books\nExistence: All revenues have a real origin\nCorrectness: The revenue is booked correctly according to sum and concept\nAllocation The booking is allocated to the correct period'),(16,'AI16','Warehouse Dispatch','Logistics','Monitoring that all inventory leaving the warehouse is authorized','Do all goods exit of the warehouse have an authorization or a reference document?','Goods in stock that will be for clients, e.g. Cellular Terminals, SIM Cards, Prepaid Cards, Modem wireline, Computers-Laptops.\n- Invoices of dispatched goods transactions\n- Dispatch Movements','Completeness and authorization: All goods leaving the warehouse are authorized\nCorrectness: All goods leaving the warehouse are registered with the correct price and quantity as specified in the dispatch order'),(17,'AI17','Adjustments applied due to inconsistencies in the inventory','Logistics','Monitoring the adjustments in the inventory','Are there revenue losses because of improper or not authorized Inventory adjustments?','All Inventory Adjustments:\n- Missng goods in the physical count of inventory\n-  Missng goods in imports\n- Stolen Equipment\n- Damaged Equipment\n- others','Completeness & Authorization: All adjustments booked are authorized\nExistence: All adjustments are based on a real source\nCorrectness: All adjustments are booked correctly according to sum and concept authorized'),(18,'AI18','Warehouse Entries','Logistics','Validate the balance of the purchases and receivables','Are there Revenue losses due to paid purchase orders without receiving the complete goods entry in the inventory?','All Inventory Entries:\n- Purchase Orders\n- Inventory Receptions\n- Purchase Orders paid','Completeness: All warehouse-entries have a purchase order\nCorrectness: All warehouse-entries have the correct amount and quantity as specified in the purchase order\nExistence: The warehouse-entry has a real source'),(19,'AI22','Numbering Ranges','Provisioning','Verify that numbering ranges are correctly activated in the different platforms. ','Are all the numbering ranges correctly loaded to the different platforms?','All Numeration Ranges in the following systems: Interconnection, Prepaid, Network-Switch, Rating, Roaming, Billing, Provisioning and the systems involved.','Completeness - All number ranges are loaded  to systems (IT and network)\nExistence - The number ranges exist\nCorrectness -  Number ranges are loaded correctly to IT and network systems\n'),(20,'AI23','Platform Routes','Provisioning','Routes and Cells Validation','Are all the routes correctly configured in the different platforms?','Mediation, Interconnection, Billing, Prepaid and Switch Platforms','Completeness: All routes are loaded into the platforms\nExistence: The routes exist and are valid\nCorrectness: The routes are loaded correctly'),(21,'AI24','Rejected records in the different platforms','Mediation, Rating & Third Party Traffic Process','Verification and Analysis of errors (Mediation, roaming, prepaid,…etc)','Are there Revenue losses due to not analyzed rejections, on time, in the different Platforms?','All Rejected EDRs:  Mediation, Rating, Interconnection and Roaming','Completeness: All rejected records aare analyzed, corrected an re-inserted into the process\nCorrectness: The re-insertion is not duplicated\nAuthorization: The cancelation of a rejected record is authorized by the responsible director.'),(22,'AIP1','Prepaid vs Accounting Reconciliation','Prepaid and Accounting','The value of the Prepaid Platform balance in principal and bonus should be registered in the Accounting System (Deferred Revenue)','Are there Revenue losses due to an inconsistency between the balance amounts in the prepaid platform vs the accounting system?','All the balance amount in the prepaid platform and its register in the accounting system','Not included in process document version 3.0'),(23,'AIP2','Not applied Payments','Accounting, Treasury and Collecting','The value of the payments should be applied to an invoice in its period','Are there revenue losses because of not applied payments?','All the payments collected','Not included in process document version 3.1');
/*!40000 ALTER TABLE `amx_procedure_catalogue` ENABLE KEYS */;
UNLOCK TABLES;

