INSERT INTO `cvg_risk` VALUES (1,4,'Incorrect Reference data','Revenue Leakage','Leakage due to Incorrect reference data: Routing (including Least cost, Best quality and best value routings), numbering schemes/portability, etc. are not configured accurately in the network and/or processing platforms, interconnect, VAS, trunks, trunk groups. ','TMF'),(2,2,'Delay in order processing','Opportunity Loss','Delay in OE processing: from the time the customer sign to the time he is connected, non-technical delay','TMF'),(3,2,'Failure in order processing','Opportunity Loss','Error or loss due to Failure in order processing','TMF'),(4,2,'Wrong order inputs','Opportunity Loss','Insufficient or Erroneous data entered by CSR or automated system. Order with errors (including \"non recognizable\" products/add-ons) Products or services incorrectly allocated to customer','TMF'),(5,3,'Failure in provisioning resulting in lack of charging','Revenue Leakage','Usage without payment: Customer/Related Service exists on network but not provisioned for billing.  Or active customers in CRM not configured in billing  - customers are not invoiced. Delay in suspension of services resulted in unbilled trafic. Wrong assignment of promortion, discounts, numbering range to a customer resulted in undercharging.','TMF'),(6,3,'Failure in provisioning resulting in lack of service','Revenue Leakage','No usage or illegitimate charges: Customers and related services live in billing, but not configured on network. E.G DSL  Service','TMF'),(7,3,'Failure in equipment provisioning','Opportunity Loss','Missing or non paid provisioning, errors in ERP \"warehouses\",  etc.','TMF'),(8,3,'Provisioning delay','Opportunity Loss','Delay in provisioning (only)','TMF'),(9,3,'Stranded Assets ','Revenue Leakage','Stranded Assets (not using your infrastructures) + unnecessary licenses. Over payment for purchasing new equipment for the network, where idle equipment in the existing infrastructure can be re-used instead. Customers can not use resources . In certain cases can also affect CAPEX (cost).','TMF'),(10,3,'Over allocation of 3rd party\'s resources','Cost Leakage',' (Access, bandwidth, etc.)','TMF'),(11,3,'Under allocation of 3rd party\'s resources ','Opportunity Loss',' (Access, bandwidth, etc.)','TMF'),(12,7,'Authentication/Authorization erroneously block service','Revenue Leakage','Failure, blocks legal users','TMF'),(13,7,'Authentication/Authorization erroneously permit service','Revenue Leakage','Authentication/Authorization Failure, grants access to no registered users (including: prepaid with negative balance, roaming, etc.)','TMF'),(14,6,'Failure in collecting of events records (File not sent to mediation platform)','Revenue Leakage','Missing, corrupted (at files and records levels)','TMF'),(15,6,'Missing processed events in Mediation output','Revenue Leakage','Missing, corrupted (at files and records levels), Incomplete file loaded into Mediation ','TMF'),(16,6,'Incorrectly ignored events records','Revenue Leakage','Wrongly dropped or  marked as errors - CDRs incorrectly rejected in Mediation, include chargeable, rejected, suspended and dropped XDRs','TMF'),(17,6,'Miss-Processing of events records','Revenue Leakage','Errors in rounding or consolidation (partial events records), Incorrect transformation of file in Mediation / Missing XDRs in Mediation output (not in errors or dropped)','TMF'),(18,5,'Failure in usage records generation','Revenue Leakage','Failure at generation: Lossed, missing and errored events, including over-metering and under-metering, incorrect rounding. Note: implies to either usage record or prepaid deduction, can be detected by SDP vs. MSC descrepancies.','TMF'),(19,8,'Compromised Service level (network outage)','Revenue Leakage','Outage, errors, etc. at network or at peer networks, congestion, prepaid down time. ','TMF'),(20,13,'Billing file not produced (detected through usage compared to billing)','Revenue Leakage','At invoice (records) or files levels','TMF'),(21,13,'Bills not generated or not sent for payments','Revenue Leakage','To banks, credit agencies or clearing houses','TMF'),(22,11,'Rating suspense/non resolved validation write-off','Revenue Leakage','Old suspended events, CDR too old to be billed','TMF'),(23,12,'Miss-Processing of rated records','Revenue Leakage','Wrongly or erroneously guided records','TMF'),(24,12,'Missing billable events for invoicing','Opportunity Loss','Includes: rated records, adjustments, postponed payments, product catalog, customers data, TAP files (roaming) etc.','TMF'),(25,12,'Miss-Processing of Invoices','Revenue Leakage','Over and under charges, rounding errors, taxation errors, etc.','TMF'),(26,12,'Miss-configuration of \"aggregated\" billing (Interconnect, MVNO)','Revenue Leakage','Usually associated with \"aggregated\" billing such as interconnect, wholesale or MVNO. Note: I/C includes voice and messaging e.g. Interworking SMS)','TMF'),(27,12,'Manual Billing inaccuracies','Revenue Leakage',NULL,'TMF'),(28,12,'Incentives applied incorrectly (also expiration date of promotions)','Revenue Leakage',NULL,'TMF'),(29,12,'Prepaid charges miss-processing','Revenue Leakage','Missing or miss-processed prepaid billing (incl. under/over charges, rounding errors, etc.)','TMF'),(30,12,'Prepaid top-ups miss-processing','Revenue Leakage','Missing or miss-processed top-ups','TMF'),(31,10,'Non-usage pricing structure set up incorrectly','Revenue Leakage','Related only to non-usage pricing (e.g. customer\'s contract, product catalog, equipment, flat rates, taxation,\\service, etc.)','TMF'),(32,10,'Rate Plans, price schemes, are not configured accurately in Billing system','Revenue Leakage','Related to usage records (for regular, premium, interconnect and roaming). New Products that are not configured in the billing and therefore  cannot be billed','TMF'),(33,9,'Failure in collection of events records for rating','Revenue Leakage','Missing, corrupted (at files and records levels) including: TAP-in, etc.)','TMF'),(34,9,'Missing processed events in output of rating','Revenue Leakage','Missing, corrupted (at rated records level) including: TAP-out, etc.','TMF'),(35,9,'Incorrectly ignored events records','Revenue Leakage','Incorrectly dropped or wrongly marked as errors','TMF'),(36,16,'Tax misstatement in financial reporting','Revenue Leakage','Tax overpayment or underpayment to tax authorities','TMF'),(37,14,'Missing or wrongly postings to accounting systems','Revenue Leakage','including: general ledger, ERP, SAP, etc.','TMF'),(38,18,'Credit Notes - Goodwill and discounts','Revenue Leakage','Wrong or non authorized credits or discounts to customers; or excessive goodwill credits','TMF'),(39,18,'Staff applying unauthorized credits to customer accounts','Revenue Leakage',NULL,'TMF'),(40,17,'Failure in  collections process','Revenue Leakage','Inconstancies between invoices and payments, missing manual payments, postponed payments, etc.','TMF'),(41,24,'Lower revenues due to arbitrage or bypass','Revenue Leakage','Most relevant for illegal activities, but may apply to legal ones','TMF'),(42,23,'Lower revenues due to high accepted dispute level','Revenue Leakage','The accepted dispute level is too high, causing over payments or lower revenues','TMF'),(43,22,'Missing receivables from dealers','Cost leakage','Not all revenues received from dealers, agents, resellers','TMF'),(44,22,'Commission payments not according to contract','Revenue Leakage','Unjustified level of commissions to resellers, agents, etc.','TMF'),(45,21,'Low/Negative revenue Margins with 3rd parties','Cost Leakage','Margins with interconnect, roaming and access, partners as well as: service, contents,  infrastructure providers and contractors.','TMF'),(46,20,'Costs Overpayment to peer operators','Revenue Leakage','Over Payments to interconnect, roaming and access.','TMF'),(47,20,'Under payments from  peer operators','Cost Leakage','Under payments from interconnect and roaming  or MVNOs (including: non fully utilized service/usage levels)','TMF'),(48,20,'Costs Overpayment to 3rd parties','Revenue Leakage','Payments to service, contents,  infrastructure providers and contractors.','TMF'),(49,1,'Discrepancies between product/offer definitions and implementation','Revenue Leakage','Products catalogs reside in billing or IN or application servers','TMF'),(50,1,'Discrepancies between campaigns definitions and implementation','Revenue Leakage','Expiry dates, promotion values, etc.','TMF'),(51,1,'No profit/Low margin','Revenue Leakage','Non involvment in Change management','TMF'),(52,14,'Financial reports misstatements','Revenue Leakage','Including Taxation','TAG'),(53,20,'Under payments from  3rd parties','Revenue Leakage','Payments from 3rd parties','TAG'),(100,26,'Assets Management',NULL,'Assets Management','TAG'),(101,25,'Collections and write offs','Revenue Leakage','Anomalous deviations in billing, collections and bad debts / write offs','TAG'),(102,15,'Deficient margins on services or products','Revenue Leakage','Revenue or cost leakage due to deficient margins on services or products','TAG'),(103,19,'Operational overload of Customer Care','Cost Leakage','Operational overload of Customer Care','TAG'),(104,27,'Deviations of unbilled accruals','Revenue Leakage','Deviations of unbilled accruals','TAG'),(105,28,'Deviations of Deferrals',NULL,'Deviations of Deferrals','TAG'),(106,29,'Logistics','Revenue Leakage','Opportunity, revenue loss or excessive costs due to deviations or delays in ordering, dispatching, shipment and invoicing of goods (RACO-386)','TAG'),(5001,3,'Fair usage policy violation','Margin leakage','Fair usage policy not defined or is defined but it is not active so traffic profiling is not performed.','RAG');
