/*!50003 CREATE*/ /*!50017 DEFINER=`USRATEAM`@`localhost`*/ /*!50003 TRIGGER `tag`.`mm_ma_runhistory_all_AFTER_DELETE` AFTER DELETE ON `mm_ma_runhistory_all` FOR EACH ROW
BEGIN
    
    delete from mm_ma_runhistory_sum 
    where OPCO_ID = old.OPCO_ID and PROCESSID = old.PROCESSID and PROCESSNAME = old.PROCESSNAME;
    
    select count(*) into @countAll from mm_ma_runhistory_all
    where OPCO_ID = old.OPCO_ID and PROCESSNAME = old.PROCESSNAME and RUN_FOR_DATE = old.RUN_FOR_DATE;
    
    select count(*) into @countSum from mm_ma_runhistory_sum
    where OPCO_ID = old.OPCO_ID and PROCESSNAME = old.PROCESSNAME and RUN_FOR_DATE = old.RUN_FOR_DATE;
    
    if (@countSum > 0) then
        update mm_ma_runhistory_sum
        set version = version - 1
        where OPCO_ID = old.OPCO_ID and PROCESSNAME = old.PROCESSNAME and RUN_FOR_DATE = old.RUN_FOR_DATE;
    end if;
    
    if (@countSum = 0 and @countAll > 0) then
        insert into mm_ma_runhistory_sum (`OPCO_ID`, `RULE_TYPE`, `PROCESSID`, `PROCESSNAME`, `RUN_FOR_DATE`, `STARTRUNDATE`, `RUN_DURATION`, `RUN_FROM`, `RUN_TO`, `DS_A`, `DS_B`, `RECORDSFETCHED_A`, `RECORDSFETCHED_B`, `RECORDSMATHCED_A`, `RECORDSMATHCED_B`, `DISC_COUNT_A`, `DISC_COUNT_B`, `ERRORLEVEL_A`, `ERRORLEVEL_B`, `TREND_A`, `TREND_B`, `KPI_COUNT`, `KPI_ALARM_LEVEL`, `KPI_JSON`)
        select `OPCO_ID`, `RULE_TYPE`, `PROCESSID`, `PROCESSNAME`, `RUN_FOR_DATE`, `STARTRUNDATE`, `RUN_DURATION`, `RUN_FROM`, `RUN_TO`, `DS_A`, `DS_B`, `RECORDSFETCHED_A`, `RECORDSFETCHED_B`, `RECORDSMATHCED_A`, `RECORDSMATHCED_B`, `DISC_COUNT_A`, `DISC_COUNT_B`, `ERRORLEVEL_A`, `ERRORLEVEL_B`, `TREND_A`, `TREND_B`, `KPI_COUNT`, `KPI_ALARM_LEVEL`, `KPI_JSON` 
        from mm_ma_runhistory_all 
        where OPCO_ID = old.OPCO_ID and PROCESSNAME = old.PROCESSNAME and RUN_FOR_DATE = old.RUN_FOR_DATE
        order by STARTRUNDATE desc
        LIMIT 1;
    end if;
    
END */;;
