/*!50003 CREATE*/ /*!50017 DEFINER=`USRATEAM`@`localhost`*/ /*!50003 TRIGGER `tag`.`mm_ma_runhistory_sum_BEFORE_INSERT` BEFORE INSERT ON `mm_ma_runhistory_sum` FOR EACH ROW
BEGIN

-- run counter
set new.VERSION = getControlResultCount(new.OPCO_ID, new.PROCESSNAME, new.RUN_FOR_DATE, new.PROCESSID);

-- if control re-run was requested from dashboard then clean-up rerun queue
delete from mm_control_rerun_queue
where 1=1
	and OPCO_ID = new.OPCO_ID 
    and PROCESSNAME = new.PROCESSNAME 
    and RUN_FOR_DATE = new.RUN_FOR_DATE
    and ACTION = 'R';

-- insert new Datasource A if not exists
if new.DS_A is not null then

	INSERT INTO dfl_datasource (`OPCO_ID`, `TYPE`, `NAME`, `STATUS_CODE`)
	select new.OPCO_ID, 'D', new.DS_A, 'A' from dual
	WHERE NOT EXISTS (
		SELECT 1 FROM dfl_datasource
		WHERE OPCO_ID = new.OPCO_ID AND NAME = new.DS_A AND TYPE = 'D'
	);

	select DATASOURCE_ID
	into @dsA
	from dfl_datasource
	WHERE OPCO_ID = new.OPCO_ID AND NAME = new.DS_A AND TYPE = 'D' limit 1;
    
	INSERT INTO dfl_dbobject (`DATASOURCE_ID`, `OWNER`)
	select @dsA, 'MM_USAGE' from dual
	WHERE NOT EXISTS (
		SELECT 1 FROM dfl_dbobject
		WHERE DATASOURCE_ID = @dsA
	);
end if;

-- insert new Datasource B if not exists
if new.DS_B is not null then
	INSERT INTO dfl_datasource (`OPCO_ID`, `TYPE`, `NAME`, `STATUS_CODE`)
	select new.OPCO_ID, 'D', new.DS_B, 'A' from dual
	WHERE NOT EXISTS (
		SELECT 1 FROM dfl_datasource
		WHERE OPCO_ID = new.OPCO_ID AND NAME = new.DS_B AND TYPE = 'D'
	);

	select DATASOURCE_ID
	into @dsB
	from dfl_datasource
	WHERE OPCO_ID = new.OPCO_ID AND NAME = new.DS_B AND TYPE = 'D' limit 1;

	
	INSERT INTO dfl_dbobject (`DATASOURCE_ID`, `OWNER`)
	select @dsB, 'MM_USAGE' from dual
	WHERE NOT EXISTS (
		SELECT 1 FROM dfl_dbobject
		WHERE DATASOURCE_ID = @dsB
	);
end if;

INSERT INTO dfl_procedure (`OPCO_ID`, `TYPE`, `SUB_TYPE`, `NAME`, `DESCRIPTION`, `STATUS_CODE`)
select 
	new.OPCO_ID, 
    'C', 
    case 
		when new.RULE_TYPE = 'R' then 'RAPO'
        when new.RULE_TYPE = 'C' then 'Money Map config'
        else 'Money Map usage'
	end, 
    new.PROCESSNAME, 
    '!!! Dataflow records for this control created automatically. Please update this "Description" including "Scheduler" and "Control assertion" values !!!', 
    'A' 
from dual
WHERE NOT EXISTS (
	SELECT 1 FROM dfl_procedure
	WHERE NAME = new.PROCESSNAME AND TYPE = 'C' and OPCO_ID = new.OPCO_ID
);

select PROCEDURE_ID
into @procedureID
from dfl_procedure
WHERE NAME = new.PROCESSNAME AND TYPE = 'C' and OPCO_ID = new.OPCO_ID limit 1;

insert into dfl_control_catalogue (`PROCEDURE_ID`, `CONTROL_TYPE`, `START_DATE`)
select 
	@procedureID, 
	case 
		when new.RULE_TYPE = 'C' then 'Config rule'
        else 'Reconciliation'
	end, 
    new.RUN_FOR_DATE
WHERE NOT EXISTS (
	SELECT 1 FROM dfl_control_catalogue
	WHERE PROCEDURE_ID = @procedureID
);

-- Update dataflow links
if new.DS_A is not null then
	
	INSERT INTO dfl_dataflow (`PROCEDURE_ID`, `DATASOURCE_ID`, `DIRECTION`)
	select @procedureID, @dsA, 'I'
	WHERE NOT EXISTS (
		SELECT 1 FROM dfl_dataflow
		WHERE PROCEDURE_ID = @procedureID and DATASOURCE_ID = @dsA and DIRECTION = 'I'
	);
end if;

if new.DS_B is not null then
	
	INSERT INTO dfl_dataflow (`PROCEDURE_ID`, `DATASOURCE_ID`, `DIRECTION`)
	select @procedureID, @dsB, 'I'
	WHERE NOT EXISTS (
		SELECT 1 FROM dfl_dataflow
		WHERE PROCEDURE_ID = @procedureID and DATASOURCE_ID = @dsB and DIRECTION = 'I'
	);
end if;

END */;;
DELIMITER ;
