CREATE DEFINER=`USRATEAM`@`localhost` FUNCTION `cvgGetTotalOpcoCoverageHistory`(opcoId int(11), forDate datetime) RETURNS decimal(20,5)
BEGIN

set @returnValue = 1;

select ifnull(s.CVG, 1) into @returnValue
from (
	select 
		SNAPSHOT_DATE,
		sum(PS_TOTAL_VALUE_RATIO * COVERAGE/100) CVG
	from cvg_history
	where OPCO_ID = opcoId
	group by SNAPSHOT_DATE
    order by 1 desc
) s where s.SNAPSHOT_DATE < forDate limit 1;
    
	RETURN ifnull(@returnValue, 1) ;
END ;;
