CREATE DEFINER=`USRATEAM`@`localhost` FUNCTION `cvgGetTotalOpcoValueHistory`(opcoId int(11), forDate datetime) RETURNS decimal(20,5)
BEGIN

set @returnValue = 0;

select ifnull(s.CVG, 0) into @returnValue
from (
	select 
		SNAPSHOT_DATE,
		sum(PS_VALUE) CVG
	from cvg_history
	where OPCO_ID = opcoId
	group by SNAPSHOT_DATE
    order by 1 desc
) s where s.SNAPSHOT_DATE < forDate limit 1;
    
	RETURN ifnull(@returnValue, 0);
END ;;
