CREATE DEFINER=`USRATEAM`@`localhost` FUNCTION `getIncidentMedianTimeDetectionToResolution`(in_opcoId int(11), in_year int(11)) RETURNS int(11)
BEGIN

    select 
        avg(TIME_DETECTION_TO_RESOLUTION) into @retVal
    from
    (
        select 
            @rownum:=@rownum+1 row_number, @total_rows:=@rownum,
            datediff(inc.DETECTION_DATE, inc.OPENING_DATE) TIME_PROBLEM_TO_DETECTION,
            datediff(inc.CLOSING_DATE, inc.DETECTION_DATE) TIME_DETECTION_TO_RESOLUTION,
            datediff(inc.CLOSING_DATE, inc.OPENING_DATE) TIME_PROBLEM_TO_RESOLUTION
        from
        (
            select 
                i.INCIDENT_ID, 
                min(a.CREATED) DETECTION_DATE, 
                ifnull(i.OPENING_DATE, current_date()) OPENING_DATE,
                ifnull(i.CLOSING_DATE, current_date()) CLOSING_DATE
            from amx_incident i
            left join amx_alarm a on a.INCIDENT_ID = i.INCIDENT_ID
            where 1=1
                and i.IMPACT_TYPE not in ('No loss', 'Unknown')
                and i.OPCO_ID = in_opcoId
                and year(a.OBJECT_DATE) = in_year
            group by i.INCIDENT_ID
        ) inc, (SELECT @rownum:=0) r
        order by datediff(inc.CLOSING_DATE, inc.DETECTION_DATE)
    ) sub
    where sub.row_number IN ( FLOOR((@total_rows+1)/2), FLOOR((@total_rows+2)/2) );

    RETURN @retVal;
END ;;
DELIMITER ;
