CREATE DEFINER=`USRATEAM`@`localhost` FUNCTION `getMetricResultCount`(metricId varchar(50), opcoId int(11), billCycle int(11), inDate datetime) RETURNS int(11)
BEGIN
	select ifnull(sum(a.cnt),0) into @metricResultCount 
    from (
		select count(*) cnt from amx_metric_result 
        where METRIC_ID = metricId and OPCO_ID = opcoId and BILL_CYCLE = billCycle and DATE = inDate
        union
		select count(*) cnt from amx_metric_result_hist 
        where METRIC_ID = metricId and OPCO_ID = opcoId and BILL_CYCLE = billCycle and DATE = inDate
	) a;
    
	RETURN @metricResultCount;
END ;;
