CREATE DEFINER=`USRATEAM`@`localhost` FUNCTION `getMissingDatos`(metricId varchar(50), opcoId int(11), billCycle int(11), inDate datetime) RETURNS tinytext CHARSET utf8
BEGIN
	select group_concat(distinct a.DATO_ID separator ', ') into @DATO_ID_MISSING 
	from AMX_METRIC_DATO_LINK a
	join AMX_METRIC_CATALOGUE mc on mc.METRIC_ID = a.METRIC_ID and mc.OPCO_ID = a.OPCO_ID
	join AMX_DATO_CATALOGUE dc on dc.OPCO_ID = a.OPCO_ID and dc.DATO_ID = a.DATO_ID and dc.RELEVANT = 'Y'
	left join AMX_DATO_LAYOUT l on l.OPCO_ID = a.OPCO_ID 
		and l.DATO_ID = a.DATO_ID
		and l.BILL_CYCLE = billCycle
		and l.PERIODICITY_ID = case when mc.FREQUENCY = 'D' then 1 when mc.FREQUENCY = 'M' then 3 when mc.FREQUENCY = 'C' then 5 end
	left join AMX_FILE_DATO b on b.OPCO_ID = a.OPCO_ID 
		and b.DATO_ID = a.DATO_ID
		and b.OPCO_ID = l.OPCO_ID 
		and b.BILL_CYCLE = l.BILL_CYCLE 
		and b.LOB_ID = l.LOB_ID 
		and b.REGION_ID = l.REGION_ID 
		and b.TECHNOLOGY_ID = l.TECHNOLOGY_ID 
		and b.SERVICE_ID = l.SERVICE_ID 
		and b.PERIODICITY_ID = l.PERIODICITY_ID
		and b.DATE = inDate
	where  a.METRIC_ID = metricId 
			and a.OPCO_ID = opcoId
		and b.FILE_ID is null;

	RETURN @DATO_ID_MISSING;
END ;;
DELIMITER ;
