DELIMITER ;;
CREATE DEFINER=`USRATEAM`@`localhost` PROCEDURE `cvgCloneControlToProductSegment`(IN cloneFromControlId INT, IN cloneFromRiskNodeId INT, IN cloneToProductSegmentId INT)
BEGIN

    DECLARE cloneControlsLoop boolean;
    DECLARE exitLoop boolean;    
    DECLARE v_ControlId int;  
    DECLARE v_RNControlId int;
    DECLARE v_Effectiveness decimal(5,2);        
    DECLARE v_cloneToRiskNodeId int;
    
    SELECT 
        EFFECTIVENESS, RN_CONTROL_ID into v_Effectiveness, v_RNControlId
    FROM cvg_risk_node_control 
    WHERE RISK_NODE_ID = cloneFromRiskNodeId and CONTROL_ID = cloneFromControlId;
    
    select RISK_NODE_ID into v_cloneToRiskNodeId
    from cvg_risk_node
    where 1=1
        and PRODUCT_SEGMENT_ID = cloneToProductSegmentId 
        and risk_id = (select risk_id from cvg_risk_node where RISK_NODE_ID = cloneFromRiskNodeId)
        and system_id = (select system_id from cvg_risk_node where RISK_NODE_ID = cloneFromRiskNodeId);

    if (v_cloneToRiskNodeId is not null and v_Effectiveness is not null and v_RNControlId is not null) then
    
        INSERT INTO cvg_risk_node_control
        (`RISK_NODE_ID`, `CONTROL_ID`, `EFFECTIVENESS`)
        VALUES 
        (v_cloneToRiskNodeId, cloneFromControlId, v_Effectiveness);

        set @newRNControlId = LAST_INSERT_ID();

        insert into cvg_risk_node_control_sub_risk_link (RN_CONTROL_ID, RN_SUB_RISK_ID)
        select @newRNControlId, a.RN_SUB_RISK_ID 
        from cvg_risk_node_sub_risk a
        join cvg_risk_node_sub_risk b on b.SUB_RISK_ID = a.SUB_RISK_ID
        join cvg_risk_node_control_sub_risk_link c on c.RN_SUB_RISK_ID = b.RN_SUB_RISK_ID and c.RN_CONTROL_ID = v_RNControlId
        where a.RISK_NODE_ID = v_cloneToRiskNodeId and b.RISK_NODE_ID = cloneFromRiskNodeId;

        call cvgRefreshRiskNodeCoverage(v_cloneToRiskNodeId); 
    
    end if;
END ;;
DELIMITER ;
