CREATE DEFINER=`USRATEAM`@`localhost` PROCEDURE `cvgMapControlFromReference`(IN toControlId INT, IN fromControlId INT)
BEGIN

	DECLARE cloneControlsLoop boolean;
	DECLARE exitLoop boolean;    
    DECLARE v_RNControlId int;
    DECLARE v_RiskNodeId int;
	DECLARE v_Effectiveness decimal(5,2); 
    
	DECLARE cloneControlsCur CURSOR FOR 
		SELECT 
			a.RN_CONTROL_ID,
            a.RISK_NODE_ID,
            a.EFFECTIVENESS 
		FROM cvg_risk_node_control a
        WHERE 1=1
			and CONTROL_ID = fromControlId 
            and not exists (select * from cvg_risk_node_control where RISK_NODE_ID = a.RISK_NODE_ID and CONTROL_ID = toControlId);

	DECLARE CONTINUE HANDLER FOR NOT FOUND SET exitLoop = TRUE;

	OPEN cloneControlsCur;
	
	cloneControlsLoop: LOOP
		
		FETCH cloneControlsCur INTO v_RNControlId, v_RiskNodeId, v_Effectiveness;
		
		IF exitLoop THEN
			CLOSE cloneControlsCur;
			LEAVE cloneControlsLoop;
		ELSE
			
			INSERT INTO cvg_risk_node_control (`RISK_NODE_ID`, `CONTROL_ID`, `EFFECTIVENESS`)
			VALUES (v_RiskNodeId, toControlId, v_Effectiveness);
            
			set @newRNControlId = LAST_INSERT_ID();
            
            
            insert into cvg_risk_node_control_sub_risk_link (RN_CONTROL_ID, RN_SUB_RISK_ID)
            select @newRNControlId, a.RN_SUB_RISK_ID 
			from tag.cvg_risk_node_sub_risk a
			join tag.cvg_risk_node_control_sub_risk_link c on c.RN_SUB_RISK_ID = a.RN_SUB_RISK_ID and c.RN_CONTROL_ID = v_RNControlId
			where a.RISK_NODE_ID = v_RiskNodeId;
            
			
			update tag.cvg_risk_node a
			set a.COVERAGE = cvgGetRiskNodeCoverage(a.RISK_NODE_ID)
			where a.RISK_NODE_ID = v_RiskNodeId;
        
		END IF;
	END LOOP cloneControlsLoop;

	
	call cvgRefreshControlCoverage(toControlId);
	call cvgRefreshControlCoverage(fromControlId);
            
	
	
    

END ;;
DELIMITER ;
