CREATE DEFINER=`USRATEAM`@`localhost` PROCEDURE `cvgMergeSubRiskInto`(IN inSubRiskIdFrom INT, IN inSubRiskIdTo INT)
BEGIN






delete from cvg_risk_node_sub_risk where RN_SUB_RISK_ID in 
(
	select RN_SUB_RISK_ID
	from (
		select RN_SUB_RISK_ID from cvg_risk_node_sub_risk rnsr
		where 1=1
			and rnsr.SUB_RISK_ID in (inSubRiskIdTo) 
			and exists (select 1 from cvg_risk_node_sub_risk where RISK_NODE_ID = rnsr.RISK_NODE_ID and SUB_RISK_ID = inSubRiskIdFrom and coverage > rnsr.coverage)	
	) s
);


delete from cvg_risk_node_sub_risk where RN_SUB_RISK_ID in (
	select RN_SUB_RISK_ID from (
		select RN_SUB_RISK_ID from cvg_risk_node_sub_risk rnsr
		where 1=1
			and rnsr.SUB_RISK_ID in (inSubRiskIdFrom) 
			and exists (select 1 from cvg_risk_node_sub_risk where RISK_NODE_ID = rnsr.RISK_NODE_ID and SUB_RISK_ID = inSubRiskIdTo)

	) s
);


update cvg_risk_node_sub_risk
set SUB_RISK_ID = inSubRiskIdTo
where 1=1
	and SUB_RISK_ID in (inSubRiskIdFrom);


update cvg_sub_risk set RELEVANT = 'N' where sub_risk_id = inSubRiskIdFrom;

END ;;
DELIMITER ;
