CREATE DEFINER=`USRATEAM`@`localhost` PROCEDURE `cvgMoveSubRiskControls`(IN inRiskNodeSubRiskId INT, IN inToRiskNodeId INT)
BEGIN

	DECLARE moveControlsLoop boolean;
	DECLARE exitLoop boolean;    
	DECLARE v_ControlId int;  
    DECLARE v_RiskNodeControlId int;
	DECLARE v_Effectiveness decimal(5,2);

	DECLARE moveControlsCur CURSOR FOR 
		SELECT 
			RN_CONTROL_ID,
			CONTROL_ID, 
            EFFECTIVENESS 
		FROM cvg_risk_node_control 
        WHERE 1=1
			and RN_CONTROL_ID in (select RN_CONTROL_ID from cvg_risk_node_control_sub_risk_link where RN_SUB_RISK_ID = inRiskNodeSubRiskId)
			and CONTROL_ID not in (select CONTROL_ID from cvg_risk_node_control where RISK_NODE_ID = inToRiskNodeId);

	DECLARE CONTINUE HANDLER FOR NOT FOUND SET exitLoop = TRUE;
    
	OPEN moveControlsCur;
	
	moveControlsLoop: LOOP
		
        set exitLoop = FALSE;
		FETCH moveControlsCur INTO v_RiskNodeControlId, v_ControlId, v_Effectiveness;
		
		IF exitLoop THEN
			CLOSE moveControlsCur;
			LEAVE moveControlsLoop;
		ELSE
			
			INSERT INTO cvg_risk_node_control (`RISK_NODE_ID`, `CONTROL_ID`, `EFFECTIVENESS`)
			VALUES (inToRiskNodeId, v_ControlId, v_Effectiveness);
			
			set @newRNControlId = LAST_INSERT_ID();
			
			
			insert into cvg_risk_node_control_sub_risk_link (RN_CONTROL_ID, RN_SUB_RISK_ID)
			select @newRNControlId, inRiskNodeSubRiskId;

		END IF;
	END LOOP moveControlsLoop;

	
    
	insert ignore into cvg_risk_node_control_sub_risk_link (RN_CONTROL_ID, RN_SUB_RISK_ID)
	SELECT 
		RN_CONTROL_ID,
		inRiskNodeSubRiskId
	FROM cvg_risk_node_control 
	WHERE 1=1
		and RISK_NODE_ID = inToRiskNodeId
		and CONTROL_ID in (
			select 
				CONTROL_ID 
			from cvg_risk_node_control a 
			join cvg_risk_node_control_sub_risk_link b on b.RN_CONTROL_ID = a.RN_CONTROL_ID 
			where RN_SUB_RISK_ID = inRiskNodeSubRiskId
		);    
    
    
END ;;
DELIMITER ;
