CREATE DEFINER=`USRATEAM`@`localhost` PROCEDURE `cvgMoveSubRiskToRiskId`(IN inSubRiskId INT, IN inRiskId INT)
proc_label:BEGIN

	DECLARE riskNodeSubRiskLoop boolean;
	DECLARE exitLoop boolean;

	DECLARE v_RiskNodeSubRiskId int; 
	DECLARE v_RiskNodeId int;
    
	DECLARE riskNodeSubRiskCur CURSOR FOR 
		SELECT 
			RN_SUB_RISK_ID, 
            RISK_NODE_ID 
		FROM cvg_risk_node_sub_risk 
        WHERE SUB_RISK_ID = inSubRiskId
        order by RN_SUB_RISK_ID;
                                    
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET exitLoop = TRUE;

    
    select RISK_ID INTO @oldRiskId
    from cvg_sub_risk
    where SUB_RISK_ID = inSubRiskId;

    
    IF @oldRiskId = inRiskId THEN
        LEAVE proc_label;
    END IF;

    
    update cvg_sub_risk
    set risk_id = inRiskId
    where SUB_RISK_ID = inSubRiskId;

    OPEN riskNodeSubRiskCur;
    
    riskNodeSubRiskLoop: LOOP

		set exitLoop = FALSE;
        FETCH riskNodeSubRiskCur INTO v_RiskNodeSubRiskId, v_RiskNodeId;

        IF exitLoop THEN
            CLOSE riskNodeSubRiskCur;
            LEAVE riskNodeSubRiskLoop;
        ELSE
			
			select 
				OPCO_ID, 
				PRODUCT_SEGMENT_ID, 
				SYSTEM_ID
			INTO @oldOpcoId, @oldProductSegmentId, @oldSystemId 
			from cvg_risk_node 
			where RISK_NODE_ID = v_RiskNodeId;

			set @newRiskNodeId = null;
			
            
			select 
				RISK_NODE_ID
			INTO @newRiskNodeId
			from cvg_risk_node 
			where RISK_ID = inRiskId and OPCO_ID = @oldOpcoId and PRODUCT_SEGMENT_ID = @oldProductSegmentId and SYSTEM_ID = @oldSystemId;
			
			
			IF @newRiskNodeId is null THEN
				INSERT INTO cvg_risk_node (OPCO_ID, PRODUCT_SEGMENT_ID, RISK_ID, SYSTEM_ID)
				VALUES (@oldOpcoId, @oldProductSegmentId, inRiskId, @oldSystemId);
				set @newRiskNodeId = LAST_INSERT_ID();
			END IF;

			
			update cvg_risk_node_sub_risk
			set RISK_NODE_ID = @newRiskNodeId
			where RN_SUB_RISK_ID = v_RiskNodeSubRiskId;
            
			
           call cvgMoveSubRiskControls(v_RiskNodeSubRiskId, @newRiskNodeId);
            
	END IF;
    
    END LOOP riskNodeSubRiskLoop;
    
	
	delete from cvg_risk_node_control_sub_risk_link where (RN_CONTROL_ID, RN_SUB_RISK_ID) in 
	(
		SELECT RN_CONTROL_ID, RN_SUB_RISK_ID from
		(
			SELECT l.RN_CONTROL_ID, l.RN_SUB_RISK_ID FROM cvg_risk_node_control_sub_risk_link l
			left join cvg_risk_node_control rnc on l.RN_CONTROL_ID = rnc.RN_CONTROL_ID
			left join cvg_risk_node_sub_risk rnsr on l.RN_SUB_RISK_ID = rnsr.RN_SUB_RISK_ID
			where rnc.RISK_NODE_ID != rnsr.RISK_NODE_ID
		) as sub
	);

	
	delete from cvg_risk_node_control where RN_CONTROL_ID in
	(
		select RN_CONTROL_ID from
		(
			SELECT rnc.RN_CONTROL_ID FROM cvg_risk_node_control rnc
			left join cvg_risk_node_control_sub_risk_link l on l.RN_CONTROL_ID = rnc.RN_CONTROL_ID
			where l.RN_CONTROL_ID is null
		) as sub
	);

	
	delete from cvg_risk_node where RISK_NODE_ID in
	(
		select sub.RISK_NODE_ID from
		(
			SELECT rn.RISK_NODE_ID FROM cvg_risk_node rn
			left join cvg_risk_node_sub_risk rnsr on rnsr.RISK_NODE_ID = rn.RISK_NODE_ID
			where rnsr.RN_SUB_RISK_ID is null
		) as sub
	);

END ;;
DELIMITER ;
