BEGIN
	update cvg_control a
	set 
		a.CTRL_COVERAGE = cvgGetControlCoverage(a.CONTROL_ID), 
		a.CTRL_COVERAGE_OVERLAP = cvgGetControlCoverageOverlap(a.CONTROL_ID)
	where a.CONTROL_ID = controlId;
