CREATE DEFINER=`USRATEAM`@`localhost` PROCEDURE `cvgRefreshControlCoverageAll`()
BEGIN

    
    delete from cvg_risk_node_control_sub_risk_link where (RN_CONTROL_ID, RN_SUB_RISK_ID) in 
    (
        SELECT RN_CONTROL_ID, RN_SUB_RISK_ID from
        (
            SELECT l.RN_CONTROL_ID, l.RN_SUB_RISK_ID FROM cvg_risk_node_control_sub_risk_link l
            left join cvg_risk_node_control rnc on l.RN_CONTROL_ID = rnc.RN_CONTROL_ID
            left join cvg_risk_node_sub_risk rnsr on l.RN_SUB_RISK_ID = rnsr.RN_SUB_RISK_ID
            where rnc.RISK_NODE_ID != rnsr.RISK_NODE_ID
        ) as sub
    );

    
    delete from cvg_risk_node_control where RN_CONTROL_ID in
    (
        select RN_CONTROL_ID from
        (
            SELECT rnc.RN_CONTROL_ID FROM cvg_risk_node_control rnc
            left join cvg_risk_node_control_sub_risk_link l on l.RN_CONTROL_ID = rnc.RN_CONTROL_ID
            where l.RN_CONTROL_ID is null
        ) as sub
    );

    
    delete from cvg_risk_node where RISK_NODE_ID in
    (
        select sub.RISK_NODE_ID from
        (
            SELECT rn.RISK_NODE_ID FROM cvg_risk_node rn
            left join cvg_risk_node_sub_risk rnsr on rnsr.RISK_NODE_ID = rn.RISK_NODE_ID
            where rnsr.RN_SUB_RISK_ID is null
        ) as sub
    );
    
    
    update cvg_control a
    set 
        a.CTRL_COVERAGE = cvgGetControlCoverage(a.CONTROL_ID), 
        a.CTRL_COVERAGE_OVERLAP = cvgGetControlCoverageOverlap(a.CONTROL_ID);
END ;;
